function resetGame(instance){
    resetField(instance);
    instance.player1.score = 0;
    instance.player2.score = 0;
    instance.timeStep = 0;
}
  
 function resetField(instance){
    instance.player1.y = (instance.height-instance.playerHeight)/2;
    instance.player2.y = (instance.height-instance.playerHeight)/2;
    instance.ball.x = (instance.width - instance.ball.size)/2;
    instance.ball.y = (instance.height - instance.ball.size)/2;
    instance.ball.xSpeed = Math.round(Math.random())==0?1.5:-1.5;
    instance.ball.ySpeed = Math.round(Math.random())==0?1.5 + 0.5 * Math.random():-1.5 - 0.5 * Math.random();
  }
  
function updatePlayer(player, instance){
    if(player.moveDown && !player.moveUp && player.y + instance.playerHeight < instance.height){
      player.y = player.y + 4;
    }
    if(!player.moveDown && player.moveUp && player.y > 0){
      player.y = player.y - 4;
    }
  }
  
function updateBall(instance){
    instance.ball.x = instance.ball.x + instance.ball.xSpeed;
    instance.ball.y = instance.ball.y + instance.ball.ySpeed;
    if(instance.ball.y >= instance.height - instance.ball.size  || instance.ball.y<=0 ){
        instance.ball.ySpeed = instance.ball.ySpeed * -1;
    }
    if(instance.ball.x >= instance.width-2*instance.playerWidth-instance.ball.size && instance.ball.x <= instance.width-instance.playerWidth-instance.ball.size && instance.ball.y<=instance.player2.y+instance.playerHeight && instance.ball.y+instance.ball.size>=instance.player2.y){
      instance.ball.xSpeed = instance.ball.xSpeed * -1;
      var increase = (instance.ball.y+instance.ball.size/2-(instance.player2.y+instance.playerHeight/2))/(instance.playerHeight/2);
      increase = increase * increase;
      instance.ball.ySpeed = instance.ball.ySpeed < 0? instance.ball.ySpeed-increase: instance.ball.ySpeed+increase;
    }
    if(instance.ball.x <= 2*instance.playerWidth && instance.ball.x >= instance.playerWidth && instance.ball.y<=instance.player1.y+instance.playerHeight && instance.ball.y+instance.ball.size>=instance.player1.y){
      instance.ball.xSpeed = instance.ball.xSpeed * -1;
      var increase = (instance.ball.y+instance.ball.size/2-(instance.player1.y+instance.playerHeight/2))/(instance.playerHeight/2);
      increase = increase * increase;
      instance.ball.ySpeed = instance.ball.ySpeed < 0? instance.ball.ySpeed-increase: instance.ball.ySpeed+increase;
    }
    if(instance.ball.x >= instance.width){
        instance.player1.score = instance.player1.score +1;
        resetField(instance);
    }
    if(instance.ball.x <= 0){
        instance.player2.score = instance.player2.score +1;
        resetField(instance);
    }
  }

 function mainLoop(instance, type1, type2){
     instance.ctx.fillStyle = "black";
     instance.ctx.fillRect(0,0,instance.width*instance.uiSize,instance.height*instance.uiSize);
     instance.ctx.fillStyle = "white";
     instance.ctx.font = (20*instance.uiSize)+"px Arial Black";
     var digits = Math.log(instance.player1.score) * Math.LOG10E + 1 | 1;
     instance.ctx.fillText(instance.player1.score+":"+instance.player2.score, instance.width*instance.uiSize/2-8*instance.uiSize-7*digits*instance.uiSize, 25*instance.uiSize);
     instance.ctx.fillRect(instance.player1.x*instance.uiSize, instance.player1.y*instance.uiSize, instance.playerWidth*instance.uiSize, instance.playerHeight*instance.uiSize);
     instance.ctx.fillRect(instance.player2.x*instance.uiSize, instance.player2.y*instance.uiSize, instance.playerWidth*instance.uiSize, instance.playerHeight*instance.uiSize);
     instance.ctx.fillRect(instance.ball.x*instance.uiSize, instance.ball.y*instance.uiSize, instance.ball.size*instance.uiSize, instance.ball.size*instance.uiSize);
     updateBall(instance);
     updatePlayer(instance.player1, instance);
     updatePlayer(instance.player2, instance);
     updateAI(instance.ball.x+instance.ball.size/2, instance.ball.y+instance.ball.size/2, instance.player2.x+instance.playerWidth/2, instance.player2.y+instance.playerHeight/2, instance.player2.score, instance.player1.score, instance.timeStep, instance.player2, instance, type2);
     if(!instance.hasHumanPlayer){
        updateAI(instance.ball.x+instance.ball.size/2, instance.ball.y+instance.ball.size/2, instance.player1.x+instance.playerWidth/2, instance.player1.y+instance.playerHeight/2, instance.player1.score, instance.player2.score, instance.timeStep, instance.player1, instance, type1);
     }
     instance.timeStep = instance.timeStep + 1;
  }

 function chooseNextAction(currentState, qValueUp, qValueNothing, qValueDown, player, epsilon, instance){
    if(Math.random()<=epsilon){
      var decision = Math.random();
      if(decision<1.0/3.0){
        instance.lastStateAction = currentState+",1";
        player.moveUp = true;
      }else if(decision<2.0/3.0){
        instance.lastStateAction = currentState+",0";
      }else{
        instance.lastStateAction = currentState+",-1";
        player.moveDown = true;
      }
    }else{
      if(qValueUp>qValueNothing && qValueUp>qValueNothing){
        instance.lastStateAction = currentState+",1";
        player.moveUp = true;
        return;
      }
      if(qValueDown>qValueUp && qValueDown>qValueNothing){
        instance.lastStateAction = currentState+",-1";
        player.moveDown = true;
        return;
      }
      instance.lastStateAction = currentState+",0";
    }
    epsilon = epsilon/1.0001;
  }

  function chooseNextStaticAction(currentState, qValueUp, qValueNothing, qValueDown, player){
    if(qValueUp>qValueNothing && qValueUp>qValueNothing){
        player.moveUp = true;
        return;
      }
      if(qValueDown>qValueUp && qValueDown>qValueNothing){
        player.moveDown = true;
        return;
      }
  }

function updateSimpleAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player, instance){
      var currentState = Math.round(ballY)-ownY<-instance.playerHeight/2?-1:Math.round(ballY)-ownY>instance.playerHeight/2?1:0;
      chooseNextStaticAction(currentState, instance.simpleAIWeights[currentState+",1"], instance.simpleAIWeights[currentState+",0"], instance.simpleAIWeights[currentState+",-1"], player);
  }
  
 function updateSimpleLearningAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player, instance){
    var currentState = "s";
    currentState = Math.round(ballY)-ownY<-instance.playerHeight/2?-1:Math.round(ballY)-ownY>instance.playerHeight/2?1:0;
    var qValueUp = Number(localStorage.getItem(currentState+",1"));
    var qValueNothing = Number(localStorage.getItem(currentState+",0"));
    var qValueDown = Number(localStorage.getItem(currentState+",-1"));
    if(qValueUp == undefined || qValueUp == null){
      qValueUp = 0;
      qValueNothing = 0;
      qValueDown = 0;
      localStorage.setItem(currentState+",1", Math.round(qValueUp*1000)/1000);
      localStorage.setItem(currentState+",0", Math.round(qValueNothing*1000)/1000);
      localStorage.setItem(currentState+",-1", Math.round(qValueDown*1000)/1000);
    }
    var reward;
    if(instance.lastStateAction != undefined){
      var qValue = Number(localStorage.getItem(instance.lastStateAction));
      if(instance.player1 == player){
        reward = instance.ball.x <= 2*instance.playerWidth && instance.ball.x >= instance.playerWidth && instance.ball.y<=player.y+instance.playerHeight && instance.ball.y+instance.ball.size>=player.y?qValue+1:qValue;
      }else{
        reward = instance.ball.x >= instance.width-2*instance.playerWidth-instance.ball.size && instance.ball.x <= instance.width-instance.playerWidth-instance.ball.size && instance.ball.y<=player.y+instance.playerHeight && instance.ball.y+instance.ball.size>=player.y?qValue+1:qValue;
      }
      reward = enemyScore>instance.lastSimpleEnemyScore?-0.1+qValue:reward;
      if(enemyScore>instance.lastSimpleEnemyScore){
        instance.lastSimpleEnemyScore = enemyScore;
      }
      qValue = qValue + 1*(reward + 0 * Math.max(qValueUp, qValueNothing, qValueDown) - qValue);
      localStorage.setItem(instance.lastStateAction, Math.round(qValue*1000.0)/1000.0);
    }
    /*if(enemyScore>0){
      if(timeStep>bestTime){
        bestTime = timeStep;
      }
      //resetGame();
      return;
    }*/
    chooseNextAction(currentState, qValueUp, qValueNothing, qValueDown, player, instance.simpleEpsilon, instance);
  }

 function updateComplexAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player, instance){
    var currentState = Math.round((Math.round(ballY)-ownY)/10) +","+Math.round(Math.abs(Math.round(ballX)-ownX)/10);
    var qValueUp = Number(localStorage.getItem(currentState+",1"));
    var qValueNothing = Number(localStorage.getItem(currentState+",0"));
    var qValueDown = Number(localStorage.getItem(currentState+",-1"));
    if(qValueUp == undefined || qValueUp == null){
      qValueUp = this.complexAIWeights[currentState+",1"];
      qValueNothing = this.complexAIWeights[currentState+",0"];
      qValueDown = this.complexAIWeights[currentState+",-1"];
      localStorage.setItem(currentState+",1", qValueUp);
      localStorage.setItem(currentState+",0", qValueNothing);
      localStorage.setItem(currentState+",-1", qValueDown);
    }
    var reward;
    if(instance.lastStateAction != undefined){
      var qValue = Number(localStorage.getItem(instance.lastStateAction));
      if(instance.player1 == player){
        reward = instance.ball.x <= 2*instance.playerWidth && instance.ball.x >= instance.playerWidth && instance.ball.y<=player.y+instance.playerHeight && instance.ball.y+instance.ball.size>=player.y?10:0;
      }else{
        reward = instance.ball.x >= instance.width-2*instance.playerWidth-instance.ball.size && instance.ball.x <= instance.width-instance.playerWidth-instance.ball.size && instance.ball.y<=player.y+instance.playerHeight && instance.ball.y+instance.ball.size>=player.y?10:0;
      }
      reward = enemyScore>instance.lastComplexEnemyScore?-100000:reward;
      if(enemyScore>instance.lastComplexEnemyScore){
        instance.lastComplexEnemyScore = enemyScore;
      }
      qValue = qValue + 0.7*(reward + 1 * Math.max(qValueUp, qValueNothing, qValueDown) - qValue);
      localStorage.setItem(instance.lastStateAction, qValue);
    }
    chooseNextAction(currentState, qValueUp, qValueNothing, qValueDown, player, instance.simpleEpsilon, instance);
  }

 function updateBasicAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player){
    if(ballY-5<ownY){
      player.moveUp = true;
    }
    if(ballY+5>ownY){
      player.moveDown = true;
    }
  }

 function updateAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player, instance, type){
    player.moveUp = false;
    player.moveDown = false;
    switch(type){
        case 0:
            this.updateBasicAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player);
            break;
        case 1:
            this.updateSimpleAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player, instance);
            break;
        case 2:
            this.updateSimpleLearningAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player, instance);
            break;
        case 3:
            this.updateComplexAI(ballX, ballY, ownX, ownY, ownScore, enemyScore, timeStep, player, instance);
            break;
    }
  }

 function addKey(e){
     for(var i=0;i<instances.length;i++){
         if(!(instances[i].hasHumanPlayer)){
            continue;
         }
        if(e.key == "s"){
            instances[i].player1.moveDown = true;
        }
        if(e.key == "w"){
            instances[i].player1.moveUp = true;
        }
    }
  }
 function removeKey(e){
    for(var i=0;i<instances.length;i++){
        if(!(instances[i].hasHumanPlayer)){
            continue;
         }
        if(e.key == "s"){
            instances[i].player1.moveDown = false;
        }
        if(e.key == "w"){
            instances[i].player1.moveUp = false;
        }
    }
  }